import List from "./List.tsx";
import Form from "./Form.tsx";
import useTodos from "./hooks/useTodos.ts";

export default function () {
  const {
    submit,
    complete,
    update,
    isLoading,
    setIsloading,
    editingId,
    setEditingId,
    error,
    setError,
    todos,
    setTodos,
  } = useTodos();

  return (
    <>
      <div>Todo App</div>
      <List
        todos={todos}
        onComplete={complete}
        editingId={editingId}
        setEditingId={setEditingId}
        onUpdate={update}
      />
      <Form onSubmit={submit} isLoading={isLoading} error={error} />
    </>
  );
}
